import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const img = require("../../../assets/hd.png")

const servOneData = [
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
]

const ServiceOneMiddle = () => {
    return (
        <View style={styles.s_middle}>
            <View style={styles.s_Box_one}>
                <Image source={img} style={styles.imgs} />
                <Text style={styles.cuts}>Haircut & Styling </Text>
            </View>
            <View style={styles.s_Box_two}>
                <Image source={img} style={styles.imgs} />
                <Text style={styles.cuts}>Haircut & Styling </Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    s_middle: {
        width: '100vw',
        height: '100vh',
        backgroundColor: "#fff",
        top: 118,
        flexDirection:'row'
    },
    s_Box_one: {
        position: 'absolute',
        width: 120,
        height: 160,
        left: 3,
        top: 0,
        backgroundColor: '#175C4C',
        borderRadius: '20px',
    },
    
    imgs: {
        position: 'absolute',
        width: 102,
        height: 120,
        left: 5,
        top: 5,
    },
    cuts: {
        position: 'absolute',
        color: "#fff",
        fontSize: 12,
        top: 133,
        left: 12,
    }
})

export default ServiceOneMiddle;
